  render() {
    return (
      <div>
        {jsxElement1}
        {jsxElement2}
      </div>
    );
  }
}

export { JSXChild };

class NoJSX extends React.Component {
  render() {
    return (
      <div>
        <p style={{ color: "green" }}>Greeting 1</p>
        <p style={{ color: "green" }}>Greeting 2</p>
      </div>
    );
  }
}

export { NoJSX };

